import React from 'react';

const TheoryPage = () => {
  return (
    <div className="theory-page">
      <h1>Theory Page</h1>
      <div className="essay">
        <p>
          [Insert your essay here]
        </p>
      </div>
      <div className="reflections">
        <h2>Design Reflections</h2>
        <p>
          [Your reflections on design choices]
        </p>
      </div>
    </div>
  );
};

export default TheoryPage;
